window.bookSummaryJSON = "<p>I knew Helena was mine the moment I saw her. </p> <p>Then I watched her die. </p> <p>I thought I’d lost her forever, so I gave in to my fallen angel nature, living in the shadows for decades. </p> <p>That was, until I found out my soul mate is a witch cursed to be reborn. </p> <p>Now I’m tasked to help her fight the forces who want to unleash Lucifer. She doesn’t know it, but we’re written in the stars. </p> <p>I’ll go to Hell and back to have another chance at a life with her.</p>"; 
